omment_id': 912367022, 'comment_body': 'This test case is redundant.', 'comment_created': datetime.datetime(2022, 7, 2, 14, 15, 8, tzinfo=datetime.timezone.utc), 'commenter': '9inpachi', 'type': 'User'}, {'comment_id': 912368059, 'comment_body': "Here's how I would test it:

