This creates a `Line` type hit as specified in the event data itself. See <https://github.com/HSF/phoenix/blob/656bcb8e1a98122bd52afcee940a72a14fc8a7c7/packages/phoenix-event-display/src/loaders/objects/phoenix-objects.ts#L262>

> I'm trying to use hitsParams as

The `hitsParams` you are trying to use don't have the correct format. `hitsParams` is expected to be an array of objects. The correct format would be:

```json
{
  "EventRun": {
    "Hits": {
      "HitsCollection": [
        [2, 10, 30],
        [2, 10, 30]
      ]
    }
  }
}
```

