I will suggest to use Jest's [`toMatchObject`](https://jestjs.io/docs/expect#tomatchobjectobject) for checking if the desired object has the necessary properties. Instead of asserting each property separately, we can then use an object.", 'comment_created': datetime.datetime(2022, 7, 6, 16, 11, 34, tzinfo=datetime.timezone.utc), 'commenter': '9inpachi', 'type': 'User'}, {'comment_id': 915038808, 'comment_body': "According to the test case description `'should take an object that represents one event and add the different objects to the graphics library and the UI controls'`, the expected behavior is that the relevant methods of graphics library and UI controls are called. But I don't see the assertions for them here.

I think a better way to test this `buildEventData` function would be to check if the scene has the objects. Just doing basic checks in the scene for collections should be enough. By basic, I mean we should just check if groups of collections we specified in the input event data exist in the scene.

The hierarchy of groups and objects (from parent to children) works this way:

```
Main Three.js Scene > Event Data Group > Event Data Type Group > Collection Group > Event Data Objects
```

You can execute code like this in console in a running Phoenix instance to see the hierarchy of objects:

![image](https://user-images.githubusercontent.com/36920441/177598537-bdb1aaa8-1d84-4062-aa05-ce938543460a.png)

We can get the event data in the tests with:

```ts
const eventDataGroup = this.graphicsLibrary
  .getSceneManager()
  .getScene()
  .getObjectByName(SceneManager.EVENT_DATA_ID);
```", 'comment_created': datetime.datetime(2022, 7, 6, 16, 27, 42, tzinfo=datetime.timezone.utc), 'commenter': '9inpachi', 'type': 'User'}, {'comment_id': 915048741, 'comment_body': 'This doesn't seem to be the correct format of event data. It looks more like an event data object parameters.

