Here's the simplest structure:

```js
{
  "Event Name (Could be anything)": {
    "event number": 234,
    "run number": 234,
    "Event Data Type (Tracks, Hits etc.)": {
      "Event Data Collection (Could be anything)": [/* Array of event data object parameters. These are the parameters used in PhoenixObjects functions. */]
